function Routes2() {
    return (
        <BrowserRouter>
            <Switch>
                <Route path="/" exact component={Numlookup} />
                <Route path="/iplookup" component={Iplookup} />
            </Switch>
        </BrowserRouter>
    )
}

export default Routes2;
